DROP TABLE IF EXISTS districts;
CREATE TABLE districts (
	id		int NOT NULL AUTO_INCREMENT,
	code	varchar(8) NOT NULL,
	name	varchar(24) NOT NULL,
	city_code	varchar(8) NOT NULL,
	PRIMARY KEY (`id`)
);

LOCK TABLES districts WRITE;


UNLOCK TABLES;
